// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

import "./Authentication.sol";
import "./UpdateTr.sol";

struct Colmeia {
    uint256 colmeiaId;
    uint16 melProduzido;
    uint256 dateColeta;
    uint256 dateEnxame;
}
struct Tun {
    bytes32 id;
    address apicultorId;
    string apiary;
    uint64 weight;
    string packing;
    string flowering;
    uint256 date;
    uint256[] colmeiasId;
}

struct Container {
    bytes32 id;
    bytes32[] tunId;
}

struct Honey {
    uint256 codigo;
    uint256 lote;
    string especializacao;
    uint64 peso;
    uint256 date;
    string localizacao;
    uint256 producaoId;
}

contract RegisterProduction {
    mapping(uint256 => Colmeia) colmeias;
    mapping(address => uint256[]) colmeiaId;

    mapping(bytes32 => Tun) tunList;
    mapping(address => bytes32[]) tunListId;

    mapping(bytes32 => Container) containerList;
    mapping(address => bytes32[]) containerListId;

    mapping(address => mapping(uint256 => Honey)) product;
    uint256[] productCode;

    address contractAuthentication;
    Authentication instanceAuthentication;
    address contractUpdateTr;
    UpdateTr instanceUpdateTr;

    constructor(address _contractAuthentication, address _contractUpdateTr) {
        contractAuthentication = _contractAuthentication;
        instanceAuthentication = Authentication(contractAuthentication);
        contractUpdateTr = _contractUpdateTr;
        instanceUpdateTr = UpdateTr(contractUpdateTr);
    }

    //Verifica se o endereço que esta chamando o contrato possui permisao para modificar o estado da rede
    modifier onlyOWNER(address _addr) {
        require(
            instanceAuthentication.activeUser(_addr) == true,
            "Permissao negada!"
        );
        _;
    }

    event UpdateColmeia(address indexed addr, Colmeia[] indexed colmeias);
    event Coleta(
        address indexed addr,
        uint256 colmeiaId,
        uint256 dateColeta,
        int256 peso
    );

    function updateColmeia(
        address _addr,
        Colmeia[] memory _colmeias
    ) public onlyOWNER(_addr) {
        emit UpdateColmeia(_addr, _colmeias);
    }

    function newTun(
        address _addr,
        string memory _apiary,
        uint64 _weight,
        string memory _packing,
        string memory _flowering,
        uint256 _date,
        uint256[] memory _colmeiasId
    ) public onlyOWNER(_addr) {
        bytes32 _id = keccak256(
            abi.encodePacked(
                _addr,
                _apiary,
                _weight,
                _packing,
                _flowering,
                _date,
                _colmeiasId
            )
        );
        tunList[_id] = Tun(
            _id,
            _addr,
            _apiary,
            _weight,
            _packing,
            _flowering,
            _date,
            _colmeiasId
        );
        tunListId[_addr].push(_id);
    }

    function newContainer(
        address _addr,
        bytes32[] memory _tunId
    ) public onlyOWNER(_addr) {
        bytes32 _id = keccak256(abi.encodePacked(_tunId));
        containerList[_id] = Container(_id, _tunId);
        containerListId[_addr].push(_id);
    }

    function forwarding(
        address _sender,
        address _recipient,
        bytes32 _product,
        bytes32 _lote,
        string memory _businessUnitType,
        bytes memory _signature
    ) public onlyOWNER(msg.sender) {
        //chamar funcao atualizarTr no contrato AtualizarTr
        instanceUpdateTr.updateTr(
            _sender,
            _recipient,
            _product,
            _lote,
            _businessUnitType,
            _signature
        );
    }
}
